import React from 'react';
import { Header, Navigation, Search, Banner, Items } from '../../components';
import { useNavigate } from 'react-router-dom';
import './home.css';

const Home = () => {
  const navigate = useNavigate();

  const handleSeeMoreClick = () => {
    navigate('/path-to-different-screen');
  };

  return (
    <div>
      <Header />
      <Search />
      <div className="mt-7">
        <Banner />

        <div className='flex justify-between items-center px-4 mt-7'>
          <h1 className='text-xl overflow-hidden whitespace-nowrap overflow-ellipsis'>Nearby Restaurants</h1>
          <p onClick={handleSeeMoreClick} className='text-primary cursor-pointer'>
            See More
          </p>
        </div>

        <div className="flex overflow-x-scroll hide-scrollbar space-x-8 px-4">
          {[...Array(5)].map((_, index) => (
            <div key={index} className='space-x-34'>
              <Items type='nearby_restaurant' />
            </div>
          ))}
        </div>

      </div>
      <Navigation />
    </div>
  );
};

export default Home;
